window.bookSummaryJSON = "<p><b>The Battle For Mars technothriller series chronicles the clash between two countries to learn the secrets hidden on Mars.</b></p> <p>Four SpaceX colonists are doomed to die in Mars orbit unless visionary entrepreneurial billionaire Chase Konrad can save them. The Daedalus Mission develops into something far more mysterious and deadly than Konrad expects. The follow-on X-ray, Omega, and Tango missions will shock you with their revelations of what really could be on Mars.</p> <p>This realistic sci-fi thriller, which could be the subject of tomorrow's headlines, will keep you on the edge of your seat until the very last second.</p>"; 
